import React from 'react';
import './Step.css'

const Step = (props) => {

    return(
        <div className="form">

        <form>
            <label>
                Name:
                <input type="text" name="name" />
            </label>
            <input type="submit" value="Submit" />
        </form>

        </div>
    )
}

export default Step;
